const AmaranthRegular = `@font-face { font-family: 'Amaranth'; font-style: normal; font-weight: 400; src: local('Amaranth Regular'), local('Amaranth-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const AmaranthItalic = `@font-face { font-family: 'Amaranth'; font-style: italic; font-weight: 400; src: local('Amaranth Italic'), local('Amaranth-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Amaranth700 = `@font-face { font-family: 'Amaranth'; font-style: normal; font-weight: 700; src: local('Amaranth Bold'), local('Amaranth-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
